            //Lines = GetLines();
            InitializeComponent();
            autoSaveTimer.Interval = 300000; //autosave every 5min
            autoSaveTimer.Start();
            ppsTimer.Interval = 1000;
            ppsTimer.Start();
            Show();

            UDPthread = new Thread(UDP_setup)
            {
                IsBackground = true
            };
            try
            {
                UDPthread.Start();
            }
            catch (Exception ex)
            { MessageBox.Show(ex.Message); }
        }

